import{_ as e,o as s,c as a,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 58.1-2216 Records and lists of license applicants and licensees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-2216.md","filePath":"vacode/58.1-2216.md"}'),n={name:"vacode/58.1-2216.md"},t=i('<h1 id="§-58-1-2216-records-and-lists-of-license-applicants-and-licensees" tabindex="-1">§ 58.1-2216 Records and lists of license applicants and licensees. <a class="header-anchor" href="#§-58-1-2216-records-and-lists-of-license-applicants-and-licensees" aria-label="Permalink to &quot;§ 58.1-2216 Records and lists of license applicants and licensees.&quot;">​</a></h1><p>A. The Commissioner shall keep a record of (i) applicants for a license under this chapter; (ii) persons to whom a license has been issued under this chapter; and (iii) persons holding a current license issued under this chapter, by license category.</p><p>B. The Commissioner shall provide a list of licensees to any licensee, as well as to any unlicensed distributor who requests a copy. The list shall state the name and business address of each licensee on the list and may include other information determined appropriate by the Commissioner.</p><p>2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0729" target="_blank" rel="noreferrer">729</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0758" target="_blank" rel="noreferrer">758</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0340" target="_blank" rel="noreferrer">340</a>.</p>',4),r=[t];function o(l,c,d,p,h,_){return s(),a("div",null,r)}const u=e(n,[["render",o]]);export{m as __pageData,u as default};
